import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import '../css/home.css'

export default class AdminHome extends Component {
    render() {
        return (
            <div>
                <div>
                    <h1>this is h1 tag</h1>
                </div>
                <div>
                    <h2>this is h2 tag</h2>
                </div>
            </div>
        )
    }
}
